import Vue from 'vue';
import VueRouter from "vue-router";

console.log(VueRouter)

Vue.use(VueRouter);

const routes = [
  {
    path: "/",
    name: "loginView",
    component: () => import("@/views/auth/loginView.vue")
  },
];

const router = new VueRouter({
  routes,
});

export default router;
